import './App.css';
import Navbar from './components/Navbar/Navbar.js';
import Footer from './components/Footer/Footer.js';
import ImageShow from './components/ImageShow/ImageShow.js';
import FlexboxPage from './components/Flexbox.js';



function App() {
  return (
    <div className="App">
    <Navbar/>
    <ImageShow/>
    <FlexboxPage/>
    <Footer/>
    </div>
  );
}

export default App;
